    false,nt"url": null,nt"notes": "This part of DS 781 presents data for the
    isopachs for the Pigeon Point to South Monterey Bay, California, region. The vector
    data file is included in "Isopachs_PigeonPointToSouthMontereyBay.zip," which is
    accessible from http://dx.doi.org/10.5066/F7N29V0Z As part of the USGS's California
    State Waters Mapping Project, a 50-m grid of sediment thickness for the seafloor
    within the limit of Californiau2019s State Waters between Pigeon Point and Southern
    Monterey Bay was generated from seismic-reflection data collected in 2009 and 2010
    (USGS activities (S-15-10-NC and S-N1-09-MB) supplemented with outcrop and geologic
    structure from DS 781. The resulting grid covers an area of approximately 850 sq
    km. The volume of sediment accumulated since the Last Glacial Maximum is approximately
    7,700 million cubic meters. Contours at 2.5-meter intervals were derived from this
    grid.",nt"owner_org": "bd2cdd5a-4d65-46c0-9937-c8381175f104",nt"extras":
